def match_parens(lst):
    # Concatenate in both possible orders
    concat1 = lst[0] + lst[1]
    concat2 = lst[1] + lst[0]

    # Function to check if a string of parentheses is balanced
    def is_balanced(s):
        balance = 0
        for char in s:
            if char == '(':
                balance += 1
            else:
                balance -= 1
            if balance < 0:
                return False
        return balance == 0

    # Check if either concatenation order results in a balanced string
    return 'Yes' if is_balanced(concat1) or is_balanced(concat2) else 'No'

def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start1, end1 = interval1
    start2, end2 = interval2
    start = max(start1, start2)
    end = min(end1, end2)
    if start >= end:  # Adjusted to consider touching intervals as no intersection
        return "NO"
    length = end - start  # Adjusted to correctly calculate the intersection length
    return "YES" if is_prime(length) else "NO"

