def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if stack:
                # Check if the current closing bracket is directly closing a bracket without anything in between
                if len(stack) > 1:
                    return True  # There's something nested
                stack.pop()
            else:
                # Unmatched closing bracket found
                return False
    # All brackets were matched but none were nested if stack is empty or contains only one element
    return False

def do_algebra(operator, operand):
    from functools import reduce

    def apply_operation(a, b, op):
        if op == '+':
            return a + b
        elif op == '-':
            return a - b
        elif op == '*':
            return a * b
        elif op == '//':
            return a // b
        elif op == '**':
            return a ** b

    # Combine operators and operands into a list of tuples for easier manipulation
    operations = list(zip(operator, operand[1:]))

    # Process ** and // first as they have the highest precedence
    for op in ['**', '//', '*', '+', '-']:
        i = 0
        while i < len(operations):
            if operations[i][0] == op:
                # Apply the operation and update the operand list
                result = apply_operation(operand[i], operand[i + 1], op)
                operand[i] = result
                # Remove the used operand and operator
                del operand[i + 1]
                del operations[i]
            else:
                i += 1

    return operand[0]

def words_in_sentence(sentence):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    # Splitting the sentence into words
    words = sentence.split()

    # Filtering words whose lengths are prime numbers
    prime_length_words = [word for word in words if is_prime(len(word))]

    # Joining the filtered words into a string
    return ' '.join(prime_length_words)

def tri(n):
    if n == 0:
        return [3]
    elif n == 1:
        return [3, 1]
    elif n == 2:
        return [3, 1, 2]

    trib = [3, 1, 2]
    for i in range(3, n + 1):
        next_value = trib[i - 1] + trib[i - 2] + trib[i - 3]
        trib.append(next_value)

    return trib

