def order_by_points(nums):
    def sorting_key(x):
        # Calculate the sum of digits of the absolute value of the number
        digit_sum = sum(int(digit) for digit in str(abs(x)))
        # For negative numbers, we want them to appear before positive numbers if they have the same digit sum.
        # Since the default sorting is ascending, we can ensure this by making the digit sum effectively lower for negative numbers.
        # We achieve this by subtracting a very small value from the digit sum of negative numbers.
        # This subtraction won't affect the order among negative numbers themselves but will ensure they come before any positive number with the same digit sum.
        adjusted_digit_sum = digit_sum - 0.1 if x < 0 else digit_sum
        # Return a tuple with the adjusted sum of digits and the index of the number to maintain stability for same sums
        return (adjusted_digit_sum, x)
    return sorted(nums, key=sorting_key)

