    expression = str(operand[0])

    for op, num in zip(operator, operand[1:]):
        expression += f" {op_dict[op].__name__} {num}"

    return eval(expression, {"__builtins__": None}, {"add": np.add, "sub": np.subtract, "mul": np.multiply, "floordiv": np.floor_divide, "pow": np.power})

