        return [3, 1]
    elif n == 2:
        return [3, 1, 2]

    # Initialize the sequence with corrected base cases
    trib = [3, 1, 2]

    # Pre-calculate tri(4) since tri(n+1) is needed for calculating tri(3)
    trib.append(1 + 4 // 2)  # This is based on the given condition for even n

    # Generate the Tribonacci sequence for n > 2
    for i in range(4, n + 1):
        if i % 2 == 0:
            next_element = 1 + i // 2
