def largest_smallest_integers(lst):
    negative_integers = [x for x in lst if x < 0]
    positive_integers = [x for x in lst if x > 0]

    largest_negative = max(negative_integers) if negative_integers else None
    smallest_positive = min(positive_integers) if positive_integers else None

    return (largest_negative, smallest_positive)

def compare_one(a, b):
    def convert(val):
        if isinstance(val, str):
            val = val.replace(',', '.')
        return float(val)

    a_converted = convert(a)
    b_converted = convert(b)

    if a_converted > b_converted:
        return a
    elif b_converted > a_converted:
        return b
    else:
        return None

def special_factorial(n):
    def factorial(x):
        if x == 0:
            return 1
        else:
            return x * factorial(x-1)

    result = 1
    for i in range(1, n + 1):
        result *= factorial(i)
    return result

def specialFilter(nums):
    def is_odd_and_greater_than_10(n):
        if n <= 10:
            return False
        str_n = str(abs(n))
        return int(str_n[0]) % 2 != 0 and int(str_n[-1]) % 2 != 0

    return sum(is_odd_and_greater_than_10(num) for num in nums)

def get_max_triples(n):
    """
    :type n: int
    :rtype: int
    """
    # Generate the array
    a = [i * i - i + 1 for i in range(1, n + 1)]
    count = 0

    # Iterate through all possible triples
    for i in range(n):
        for j in range(i + 1, n):
            for k in range(j + 1, n):
                if (a[i] + a[j] + a[k]) % 3 == 0:
                    count += 1
    return count

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]

    if planet1 not in planets or planet2 not in planets:
        return ()

    start = min(planets.index(planet1), planets.index(planet2))
    end = max(planets.index(planet1), planets.index(planet2))

    return tuple(planets[start+1:end])

