    """
    return sorted(arr)

def is_nested(string):
    stack = []
    nested_found = False
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if stack:
                stack.pop()
                # Check if the current closing bracket creates a nested structure
                if stack:
                    nested_found = True
            else:
                # If a closing bracket is found without a matching opening, string is invalid
                return False
    # Return True if a nested structure was found and stack is empty (all brackets matched)
    return nested_found and not stack

def split_words(txt):
    if ' ' in txt:
        return txt.split()
    elif ',' in txt:
        return txt.split(',')
    else:
        # Count the number of lowercase letters with odd order in the alphabet
        odd_lower_count = sum((ord(char) - ord('a')) % 2 == 0 for char in txt if char.islower())
        # Check if there were no spaces or commas to split on
        if odd_lower_count > 0:
            return odd_lower_count
        else:
            # Return the original text in a list if it doesn't contain spaces, commas, or lowercase letters
            return [txt]

def do_algebra(operator, operand):
    expression = str(operand[0])
    for op, num in zip(operator, operand[1:]):
        expression += f' {op} {num}'
    return eval(expression)

def get_odd_collatz(n):
    odd_numbers = []
    while n != 1:
        if n % 2 == 1 and n not in odd_numbers:
            odd_numbers.append(n)
        n = 3 * n + 1 if n % 2 else n // 2
    odd_numbers.append(1)  # Ensure 1 is always included
    return sorted(odd_numbers)

def can_arrange(arr):
    # Check if the array is already in ascending or descending order
    is_ascending = all(arr[i] <= arr[i + 1] for i in range(len(arr) - 1))
    is_descending = all(arr[i] >= arr[i + 1] for i in range(len(arr) - 1))

    # If either is true, no arrangement is needed, return -1
    if is_ascending or is_descending:
        return -1

    # Otherwise, find the largest index where the element is not greater
    # than or equal to the element immediately preceding it
    for i in range(len(arr) - 1, 0, -1):
        if arr[i] < arr[i - 1]:
            return i
    return -1

def tri(n):
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 1]
    elif n == 2:
        return [1, 1, 1]
    sequence = [1, 1, 1]
    for i in range(3, n + 1):
        sequence.append(sequence[i - 1] + sequence[i - 2] + sequence[i - 3])
    return sequence

def words_in_sentence(sentence):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    words = sentence.split()
    prime_length_words = [word for word in words if is_prime(len(word))]
    return ' '.join(prime_length_words)
